All inputs are scoped for the current system, that is derived from the sytems input list to std.grow. That means contrary to the usual nix-UX, in most cases, you don't need to worry about system. The current system will be "lifted up" one level, while still providing full access to all sytems for cross-compliation scenarios. # inputs.a.packages.${system}
{ inputs.a.packages.pkg1 = {}; inputs.a.packages.pkg2 = {}; /* ... */ inputs.a.packages.${system}.pkgs1 = {}; inputs.a.packages.${system}.pkgs2 = {}; /* ... */
} deSystemize's implementation let l = builtins; /* A helper function which hides the complexities of dealing with 'system' properly from you, while still providing escape hatches when dealing with cross-compilation. You can use this function independently of the rest of std. */ deSystemize = system: fragment: if l.isAttrs fragment && l.hasAttr "${system}" fragment then fragment // fragment.${system} else l.mapAttrs ( # _ consumes input's name # fragment -> maybe systems _: fragment: if l.isAttrs fragment && l.hasAttr "${system}" fragment then fragment // fragment.${system} else l.mapAttrs ( # _ consumes input's output's name # fragment -> maybe systems _: fragment: if l.isAttrs fragment && l.hasAttr "${system}" fragment then (fragment // fragment.${system}) else fragment ) fragment ) fragment;
in deSystemize

